import * as React from 'react';
import { Box, Typography, DialogTitle } from '@mui/material';
import styles from '../../styles/App.module.scss';
import classNames from 'classnames/bind';
import pen from '../../assets/images/testPen.png';

const cx = classNames.bind(styles);

function BTConnect() {
  return (
    <>
      <main>
        <div className={styles.Innerwrap}>
          <section className={styles.CommonPage}>
            <h2 className={cx('mTit')}>BT 연결</h2>
            <ul className={styles.PageInner}>
              <li className={styles.imgBox}>
                <img src={pen} alt="" />
              </li>
              <li className={cx('mTxt')}>
                Wi-fi펜의 전원을 켜신 뒤<br />
                위의 펜 버튼을 눌러주세요.
              </li>
            </ul>
          </section>
        </div>
      </main>
    </>
  );
}
export default BTConnect;
